import React from 'react'
import './statics/styles/Principal.scss'
import Competences from './layouts/competences/Competences'
import svg from './statics/images/test.svg'

// <img
//   src={svg}
//   alt=""
//   style={{ width: '100%' }}
// />
function Principal () {
  return (
    <div className='Principal'>
      <div className="rosa" style={{ height: 150 }}>
        rosa
        { svg }
      </div>
      <Competences />
      <div className="imortel" style={{ height: 100 }}>
        imortel
      </div>
    </div>
  )
}

export default Principal
